-- ----------------------------------------

data Tree = T [Tree] [Int] deriving Show

solve1 :: Tree -> Int
solve1 = sumMeta

sumMeta :: Tree -> Int
sumMeta (T cs ms) = sum (map sumMeta cs) + sum ms

solve2 :: Tree -> Int
solve2 = sumMeta2

sumMeta2 :: Tree -> Int
sumMeta2 (T [] ms) = sum            ms
sumMeta2 (T cs ms) = sum . map ind $ ms
  where
    l = length cs
    ind i
     | i < 1 || i > l = 0
     | otherwise      = sumMeta2 $ cs !! (i - 1)

-- ----------------------------------------

fromString :: String -> Tree
fromString = fst . parseTree . map read . words

type Parser a = [Int] -> (a, [Int])

parseTree :: Parser Tree
parseTree (x1 : x2 : xs) =
  (T cs ms, xs2)
  where
    (cs, xs1) = times x1 parseTree xs
    (ms, xs2) = times x2 parseMeta xs1

parseMeta :: Parser Int
parseMeta (x1 : xs) = (x1, xs)

times :: Int -> Parser a -> Parser [a]
times 0 p xs = ([], xs)
times n p xs
  | n > 0 = (v1 : vs, xs2)
  where
    (v1, xs1) = p xs
    (vs, xs2) = times (n - 1) p xs1

